// Header for Home.jsx, should add UserLogin.jsx, 
// Admin.jsx and CreateAcc.jsx Headers, also add Logo 
// and title for layout
// up to date -- wxm, Jason
import React from 'react';
import { Link } from 'react-router-dom';

function Header({ userEmail }) {
  return (
    <div className={userEmail ? "User-header" : "Home-header"}>
      <div className="header-title">
        <h1>Group 8 CarBiddingSystem</h1>
      </div>
      <div className="group-info">
        <p>Group Members: Anning Tian, Pingyi Xu, QinHao Zhang, Xinmeng Wu</p>
        <p>Class: CS5200 Database Management Systems</p>
        <p>Professor: Dr. Tehmina Amjad</p>
      </div>
      <nav className="app-nav">
        <Link to="/" className="nav-link"><button className="btn">Home</button></Link>
        {!userEmail && <Link to="/login" className="nav-link"><button className="btn">Login</button></Link>}
        {!userEmail && <Link to="/create-account" className="nav-link"><button className="btn">Create Account</button></Link>}
        {!userEmail && <Link to="/admin-login" className="nav-link"><button className="btn">Admin Login</button></Link>}
        {userEmail && <div className="user-info">
          <span>Welcome, {userEmail}</span>
          <Link to="/" className="nav-link"><button className="btn">Log Out</button></Link>
        </div>}
      </nav>
    </div>
  );
}

export default Header;
